import React from 'react';
import {
  Box,
  Typography,
  TextField,
  Grid,
  Button,
  Snackbar,
  Alert,
  InputAdornment
} from '@mui/material';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import EmailIcon from '@mui/icons-material/Email';
import SubjectIcon from '@mui/icons-material/Subject';

export default function ContactoForm() {
  const [formData, setFormData] = React.useState({
    nombre: '',
    correo: '',
    asunto: '',
    mensaje: ''
  });

  const [errores, setErrores] = React.useState({});
  const [enviado, setEnviado] = React.useState(false);

  const validar = () => {
    const newErrors = {};
    const correoRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

    if (!formData.nombre.trim()) newErrors.nombre = 'Este campo es obligatorio';
    if (!formData.correo || !correoRegex.test(formData.correo)) newErrors.correo = 'Ingrese un correo válido';
    if (!formData.asunto.trim()) newErrors.asunto = 'Debe ingresar un asunto';
    if (!formData.mensaje.trim()) newErrors.mensaje = 'Debe escribir un mensaje';

    setErrores(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validar()) {
      console.log('Mensaje enviado:', formData); // Simulación
      setEnviado(true);
      setFormData({
        nombre: '',
        correo: '',
        asunto: '',
        mensaje: ''
      });
    }
  };

  return (
    <Box
      component="form"
      onSubmit={handleSubmit}
      noValidate
      sx={{
        maxWidth: 700,
        mx: 'auto',
        mt: 5,
        p: 4,
        boxShadow: 4,
        bgcolor: '#fafafa',
        borderRadius: 4,
        display: 'flex',
        flexDirection: 'column',
        gap: 3
      }}
    >
      {/* Encabezado institucional */}
      <Typography variant="h4" sx={{ fontWeight: 'bold', bgcolor: '#388e3c', color: 'white', p: 2, borderRadius: 2, textAlign: 'center' }}>
        Escríbenos
      </Typography>

      {/* Instrucciones */}
      <Typography variant="body1">
        ¿Tienes preguntas o sugerencias? Completa este formulario y te responderemos en un plazo máximo de <strong>48 horas</strong>.
      </Typography>

      {/* Campos */}
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6}>
          <TextField
            name="nombre"
            label="Nombre"
            autoComplete="name"
            fullWidth
            value={formData.nombre}
            onChange={(e) => setFormData({ ...formData, nombre: e.target.value })}
            error={!!errores.nombre}
            helperText={errores.nombre}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <AccountCircleIcon sx={{ color: '#777' }} />
                </InputAdornment>
              )
            }}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            name="correo"
            label="Correo electrónico"
            autoComplete="email"
            fullWidth
            value={formData.correo}
            onChange={(e) => setFormData({ ...formData, correo: e.target.value })}
            error={!!errores.correo}
            helperText={errores.correo}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <EmailIcon sx={{ color: '#777' }} />
                </InputAdornment>
              )
            }}
          />
        </Grid>
      </Grid>

      <TextField
        name="asunto"
        label="Asunto"
        fullWidth
        value={formData.asunto}
        onChange={(e) => setFormData({ ...formData, asunto: e.target.value })}
        error={!!errores.asunto}
        helperText={errores.asunto}
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <SubjectIcon sx={{ color: '#777' }} />
            </InputAdornment>
          )
        }}
      />

      <TextField
        name="mensaje"
        label="Mensaje"
        multiline
        rows={6}
        fullWidth
        value={formData.mensaje}
        onChange={(e) => setFormData({ ...formData, mensaje: e.target.value })}
        error={!!errores.mensaje}
        helperText={errores.mensaje}
      />

      {/* Botones */}
      <Box sx={{ display: 'flex', gap: 2 }}>
        <Button type="submit" variant="contained" sx={{ bgcolor: '#388e3c', '&:hover': { bgcolor: '#2e7d32' }, fontWeight: 'bold' }} fullWidth>
          Enviar
        </Button>
        <Button variant="outlined" color="secondary" onClick={() => setFormData({ nombre: '', correo: '', asunto: '', mensaje: '' })} fullWidth>
          Cancelar
        </Button>
      </Box>

      {/* Confirmación institucional */}
      <Snackbar
        open={enviado}
        autoHideDuration={4000}
        onClose={() => setEnviado(false)}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert severity="success" variant="filled" onClose={() => setEnviado(false)} sx={{ bgcolor: '#1976d2', color: 'white' }}>
          ¡Tu mensaje ha sido enviado correctamente!
        </Alert>
      </Snackbar>
    </Box>
  );
}
